import React from "react";

export default function Nav(props) {
  return (
    <>
      

      <section className="mx-auto bg-slate-500">
        
        
        <h1 className="">Enter your text</h1>
        <textarea name="ak" id="p1" cols="30" rows="10" className="text-red-200 w-11/12 mx-4 mt-3 rounded-xl outline-2 outline-red-300 border-2 border-red-900"></textarea>

        <h1>dfd</h1>
      </section>
      
    </>
  );
}
